// src/components/SanJose.js
// San Jose page view

import React from 'react';
import '../assets/styles/main.css';

const image = require('../assets/images/photo1.JPG');

function SanJose() {
    return (
        <div>
            <h1>San Jose</h1>
            <div className="poem-container">
                <img src={image} alt="San Jose" />
            </div>
        </div>
    );
};

export default SanJose;
